import React from "react";
import '../css/contact.css'; // Import your CSS file

const Contact = () => {
    return (
        <div className="contact">
            <div className="box_contact">
                <img src="/telephone-call.png" alt="Telephone Call" />
            </div>
        </div>
    );
};

export default Contact;
